sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...

  var pdfDoc = new sn_pdfgeneratorutils.PDFGenerationAPI;
  var result = pdfDoc.getDocumentFields(inputs.attachment);
  var fieldType = pdfDoc.getDocumentFieldsType(inputs.attachment);
  var resultArray = [];
  if (fieldType.status == 'success') {
    var propertyArray = Object.getOwnPropertyNames(fieldType.fields_type);
    for (var j=0; j<propertyArray.length;j++) {
      var fieldName = propertyArray[j].toString();
      var lineObj = {
        "field_name" : fieldName,
        "field_type" : fieldType.fields_type[fieldName].type.toString()
      }
      resultArray.push(lineObj);
  }

   outputs.fields = result.fields;
   outputs.fields_object_array = resultArray;
  }
  outputs.status = fieldType.status;



})(inputs, outputs);

